import React from "react";

function education() {
  return (
    <div>
      <div>
        <h1 className="mt-10 text-4xl font-bold text-center">Education</h1>
        <div>
          <div className="flex items-center justify-center ">
            <div className="containerr border border-solid border-black w-3/4 mt-12">
              <p className="text-xl ml-8 mt-4 font">Schools I attended</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default education;
